import React from 'react'
import { useSelector } from 'react-redux'


function Home() {
    const isLogged = useSelector((store) => store.authReducer.isLogged);
    console.log(isLogged)
    console.log(this.data)
    return isLogged ?(
        <div>
            hola
        </div>
    ): (
        <div>no logueado</div>
    )
}

export default Home
